script: |
  super -f text -I q6380.spq | sort > q6380.out

inputs:
  - name: q6380.spq
    data: |
      SELECT COUNT ( * ) * COUNT ( * ) FROM tab0 (FORMAT parquet) WHERE NOT ( NOT - 84 + - + 2 * + - col0 NOT BETWEEN - + CAST ( NULL AS INTEGER ) * + col2 * + - col2 / ( + - col0 ) * - 41 + CAST ( col2 AS INTEGER ) - - 8 / col0 * - col0 - col0 + col0 AND col1 );
  - name: tab0

outputs:
  - name: q6380.out
    data: |
      4
